import React, { useState, useEffect } from "react";
import { useLocation, useNavigate } from "react-router-dom";
import axios from "axios";
import "./eventlist.css";

const EventList = () => {
  const [events, setEvents] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");
  const location = useLocation();
  const navigate = useNavigate();

  useEffect(() => {
    // Fetch events from the backend
    const fetchEvents = async () => {
      try {
        if (location.state?.events) {
          // Use events passed from AddEvent if available
          setEvents(location.state.events);
        } else {
          const response = await axios.get("http://127.0.0.1:8000/events");
          setEvents(response.data);
        }
        setLoading(false);
      } catch (err) {
        setError("Failed to fetch events. Please try again.");
        setLoading(false);
      }
    };

    fetchEvents();
  }, [location.state]); // Re-fetch events if location.state changes

  const handleDelete = async (eventId) => {
    if (window.confirm("Are you sure you want to delete this event?")) {
      try {
        await axios.delete(`http://127.0.0.1:8000/events/${eventId}`);
        alert("Event deleted successfully!");

        // Update the local state to reflect the deletion
        setEvents(events.filter((event) => event.event_id !== eventId));
      } catch (err) {
        console.error("Error deleting event:", err.response?.data || err.message);
        alert("Failed to delete the event. Please try again.");
      }
    }
  };

  if (loading) return <p>Loading events...</p>;
  if (error) return <p style={{ color: "red" }}>{error}</p>;

  return (
    <div className="event-list">
  {/* Header with Navbar */}
  <header className="navbar">
  </header>
    <div className="navbar-section left">
      <button className="navbar-btn" onClick={() => navigate("/add-event")}>
        Add Event
      </button>
    </div>
    <div className="navbar-section right">
      <button className="navbar-btn" onClick={() => navigate("/login")}>
        Log out
      </button>
    </div>



      <div className="events-container">
        {events.map((event) => (
          <div key={event.event_id} className="event-card">
            <img src={event.image_url} alt={event.event_name} className="event-image" />
            <h2>{event.event_name}</h2>
            <p><strong>Date:</strong> {new Date(event.dateandtime).toLocaleString()}</p>
            <p><strong>Category:</strong> {event.category}</p>
            <p><strong>Organised By:</strong> {event.organised_by}</p>
            <p><strong>Location:</strong> {`${event.city}, ${event.state}, ${event.country}`}</p>
            <p><strong>Address:</strong> {event.address}</p>
            <div className="card-buttons">
              <button
                className="edit-btn"
                onClick={() => navigate("/add-event", { state: { event } })}
              >
                Edit
              </button>
              <button
                className="delete-btn"
                onClick={() => handleDelete(event.event_id)}
              >
                Delete
              </button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default EventList;
